import React from "react";
import Card from "./Cards";
import Sdata from "./Sdata";

function App() {
  return (
    <>
      <h1>List of Series</h1>

      {Sdata.map((val) => {
        return (
          <Card
            key={val.id}
            imgSrc={val.imgSrc}
            sname={val.sname}
            title={val.title}
            links={val.links}
          />
        );
      })}
    </>
  );
}
export default App;
